import { useEffect } from "react";
import getmoviedata from "../services/movies";


const Moviesection=()=>{

   useEffect(()=>{
        
       const fetchdata = async()=>{
        
        const res= await getmoviedata();
        console.log(res);

       }
    
       
         fetchdata();
   });
    
   return <></>
}

export default Moviesection;
